import React from 'react'
import MoviesLists from './MoviesLists'
import data from './data.json'

const App = () => {
  return (
    <>
    {
      data.map((value) => {
<MoviesLists 
title={Title}
year={Year}
runtime={RunTime}
img={Poster}
/>

      })
    }
    
    </>
  )
}

export default App
